  | TodoUpdateSuccess
  | TodoDelete
  | TodoDeleteFail
  | TodoDeleteSuccess
  | TodoFilter
  | TodoFilterFail
  | TodoFilterSuccess
  | CategoryByUser
  | CategoryByUserSuccess
  | CategoryByUserFail;

