    this.rowClicked.emit(data);
  }
  handlesort(data: SortItem[]) {
    this.sort.emit(data);
  }
  handleSelectRow(data: Object) {
    this.rowsSelected.emit(data);
  }
  handleSearch(textSearch: string) {
    this.textSearch.emit(textSearch);
  }
  //Responsive
